import "./Expenses.css";
import ExpenseItem from "./ExpenseItem";

function Expenses(props) {
  return (
    <div>
      <ExpenseItem
        title={props[0].title}
        price={props[0].price}
        date={props[0].date}
      />
      <ExpenseItem
        title={props[1].title}
        price={props[1].price}
        date={props[1].date}
      />
      <ExpenseItem
        title={props[2].title}
        price={props[2].price}
        date={props[2].date}
      />
      <ExpenseItem
        title={props[3].title}
        price={props[3].price}
        date={props[3].date}
      />
    </div>
  );
}

export default Expenses;
